    "pacioos-nearshore-sensor-11-ns11-saipan-cnmi",nt"isopen": false,nt"url":
    null,nt"notes": "The nearshore sensors are part of the Pacific Islands Ocean
    Observing System (PacIOOS) and are designed to measure a variety of ocean parameters
    at fixed point locations. NS11 is approximately 20 meters offshore of Puntan Babpot
    near the golf course at Laolao Bay on the east shore of Saipan in the Commonwealth
    of the Northern Mariana Islands (CNMI) and is mounted to the bottom in about 3 meters
    of water. The instrument is a Sea-Bird Electronics model 16+ V2 coupled with a WET
    Labs ECO-FLNTUS combination sensor.",nt"license_title": null,nt"extras":
